import { createMuiTheme } from '@material-ui/core/styles'
import { indigo, deepOrange, grey } from '@material-ui/core/colors'
const theme = createMuiTheme({
  palette: {
    background: {
      default: grey[200],
    },
    primary: {
      main: indigo[900],
    },
    secondary: {
      main: deepOrange[800],
    },
    black: {
      main: indigo[800],
    },
  },
  typography: {
    allVariants: {
      color: 'black',
    },
  },
})
export default theme
